/*Table structure for table `zx_areas` */

DROP TABLE IF EXISTS `zx_areas`;

CREATE TABLE `zx_areas` (
  `base_areaid` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '地址ID',
