/*Table structure for table `zx_shops` */

DROP TABLE IF EXISTS `zx_shops`;

CREATE TABLE `zx_shops` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(64) NOT NULL COMMENT '店铺名称',
  `owner_name` varchar(64) NOT NULL COMMENT '拥有人',
  `owner_phone` varchar(11) NOT NULL COMMENT '拥有人电话',
  `contact_name` varchar(64) DEFAULT NULL COMMENT '联系人',
  `contact_phone` varchar(11) DEFAULT NULL COMMENT '联系人电话',
  `address` varchar(32) DEFAULT NULL COMMENT '所在省市区',
  `address_detail` varchar(255) DEFAULT NULL COMMENT '详细地址',
  `type` enum('1','2','3','4') DEFAULT NULL COMMENT '店铺类别',
  `auth_imgs` longtext COMMENT '资质照片集',
  `verify_status` enum('1','2','3','4','5') DEFAULT '1' COMMENT '审核状态',
  `status` enum('0','1') DEFAULT NULL COMMENT '禁用状态',
  `balance` decimal(10,2) DEFAULT '0.00' COMMENT '店铺余额',
  `ex_status` enum('0','1') DEFAULT '1' COMMENT '试用7天',
  `ex_start_time` int(11) DEFAULT '0' COMMENT '试用开始时间',
  `ex_end_time` int(11) DEFAULT '0' COMMENT '试用结束时间',
  `pay_method` enum('1','2','3','4','5') DEFAULT NULL COMMENT '认购方式',
  `use_start_time` int(11) DEFAULT '0' COMMENT '使用开始时间',
  `use_end_time` int(11) DEFAULT '0' COMMENT '使用结束时间',
  `created_at` int(11) DEFAULT '0',
  `updated_at` int(11) DEFAULT '0',
  `ali_appid` varchar(255) NOT NULL DEFAULT '' COMMENT '支付宝应用ID',
  `ali_private_key` varchar(255) NOT NULL DEFAULT '' COMMENT '支付宝支付私钥',
  `ali_public_key` varchar(255) NOT NULL DEFAULT '' COMMENT '支付宝支付公钥',
  `wx_mch_id` varchar(255) NOT NULL DEFAULT '' COMMENT '微信商户号',
  `wx_appid` varchar(255) NOT NULL DEFAULT '' COMMENT '微信应用ID',
  `wx_secret` varchar(255) NOT NULL DEFAULT '' COMMENT '微信密钥',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

